$(document).ready(function () {

    var body = $('body');
    var mainmenu = $('.main-menu');

    /* page load as iframe */
    if (self !== top) {
        body.addClass('iframe');
    } else {
        body.removeClass('iframe');
    }

    /* Dropdown toggle */
    //$('.dropdown-toggle').dropdown()

    /* floating input text fields */
    $('.floating-input').each(function () {
        if (!$(this).val() || $(this).val().length === 0) {
            //$(this).parent().removeClass('active')
        } else {
            $(this).parent().addClass('active')
        }
    })
    $('.floating-input').on('blur', function () {
        if (!$(this).val() || $(this).val().length === 0) {
            $(this).parent().removeClass('active')
        } else {
            $(this).parent().addClass('active')
        }

        return false;
    });


    /* menu open close */
    $('.main-menu .btn-close').on('click', function () {
        if (body.hasClass('menu-overlay') === true) {
            body.removeClass('menu-open');
        } else {
            body.removeClass('menu-active');
            body.removeClass('menu-open');
            $('html').removeClass('menu-open');
        }

        return false;
    })
    $('.menu-btn').on('click', function () {
        if (body.hasClass('menu-overlay') === true) {
            body.addClass('menu-open');
        } else {
            body.addClass('menu-active');
            body.addClass('menu-open');
            $('html').addClass('menu-open');
        }

        return false;
    });
    $('.main-menu + .backdrop').on("click", function (e) {
        if (body.hasClass('menu-open') === true) {
            body.removeClass('menu-open');
        }

        return false;
    });



    /* menu style switch */
    $('#menu-pushcontent').on('change', function () {
        if ($(this).is(':checked') === true) {
            body.addClass('menu-push-content');
            mainmenu.css('display', 'block');
            body.removeClass('menu-overlay');
        }

        return false;
    });
    $('#menu-overlay').on('change', function () {
        if ($(this).is(':checked') === true) {
            body.removeClass('menu-push-content');
            mainmenu.css('display', 'block');
            body.addClass('menu-overlay');
        }

        return false;
    });


    /* back page navigation */
    $('.back-btn').on('click', function () {
        window.history.back();

        return false;
    });

    /* float label checking input is not empty */
    $('.float-label .form-control').on('blur', function () {
        if ($(this).val() || $(this).val().length != 0) {
            $(this).closest('.float-label').addClass('active');
        } else {
            $(this).closest('.float-label').removeClass('active');
        }

        return false;
    })
});


$(window).on('load', function () {
    setTimeout(function () {
        $('.loader-display').fadeOut('slow');
    }, 500);


    /* Background */
    $('.background').each(function () {
        var imgpath = $(this).find('img');
        $(this).css('background-image', 'url(' + imgpath.attr('src') + ')');
        imgpath.hide();
    })

    /* url path on menu */
    var path = window.location.href; // because the 'href' property of the DOM element is the absolute path
    $(' .main-menu ul a').each(function () {
        if (this.href === path) {
            $(' .main-menu ul a').removeClass('active');
            $(this).addClass('active');
        }
    });


});

$(window).on('scroll', function () {

    /* scroll from top and add class */
    if ($(document).scrollTop() > '10') {
        $('.header').addClass('active');
    } else {
        $('.header').removeClass('active');
    }
});


jQuery(function($) {
    setInterval(function() {
      var date = new Date(),
          time = date.toLocaleTimeString();
      $(".clock").html(time);
    }, 1000);
  });

  
$(window).on('resize', function () {

});



//'use strict';

$(window).on('load', function () {
    var body = $('body');
    switch ($('body').attr('data-page')) {
        case "homepage":
            /* carousel */
            var swiper = new Swiper('.introduction', {
                autoplay: true,
                pagination: {
                    el: '.swiper-pagination',
                },
            });
            
            var swiper = new Swiper('.swiper-users', {
                slidesPerView: 'auto',
                spaceBetween: 15,
                pagination: 'false'
            });

            var swiper = new Swiper('.addsendcarousel', {
                slidesPerView: '3',
                spaceBetween: 15,
                pagination: {
                    el: '.swiper-pagination',
                },
            });


            var swiper = new Swiper('.swiper-home-count', {
                slidesPerView: 2,
                spaceBetween: 15,
                pagination: false
               
            });

            var swiper = new Swiper('.swiper-home-article', {
                slidesPerView: 2,
                spaceBetween: 15,
                breakpoints: {
                    480: {
                        slidesPerView: 1,
                        spaceBetween: 15,
                    },
                    640: {
                        slidesPerView: 3,
                        spaceBetween:15,
                    },
                    1024: {
                        slidesPerView: 3,
                        spaceBetween: 15,
                    },
                    1440: {
                        slidesPerView: 3,
                        spaceBetween: 15,
                    },
                    1920: {
                        slidesPerView: 4,
                        spaceBetween: 15,
                    }
                },
                pagination: {
                    el: '.swiper-pagination',
                },
            });


            $('#more-expand-btn').on('click', function () {
                $('#more-expand').addClass("active");
                $(this).addClass("active");
            });

            /* carousel */
            var swiper3 = new Swiper('.categoriestab1', {
                slidesPerView: 'auto',
                spaceBetween: 15,
            });
            var swiper4 = new Swiper('.categories2tab1', {
                slidesPerView: 'auto',
                spaceBetween: 10,
            });

          
            break;
        case "landing":
            /* carousel */
            var swiper = new Swiper('.introduction', {
                autoplay: true,
                pagination: {
                    el: '.swiper-pagination',
                },
            });

            break;
        case "tooltips":
            $(function () {
                $('[data-toggle="tooltip"]').tooltip()
            });
            
            break;
    }
});

